        public IActionResult Index(int page = 1,string? Search="")
        {
            // Número de elementos por página
            int itemsPerPage = 6;


            // Obtener lista completa de items (puede ser de una base de datos)
              List<Product> items = new List<Product>();
              

            if (!String.IsNullOrEmpty(Search))
            {
                Console.WriteLine(  "Serach value : "+Search);
                var list = getList();
                var list2 = list.Where(x => x.Name.ToLower().Contains(Search) 
                                      ||x.Description.ToLower().Contains(Search) );
                items= list2.ToList();
            }
            else
            {
                items = getList();
               
            }

            // Total de items
            int totalItems = items.Count();
            // Aplicar paginación con Skip y Take
            var paginatedItems = items.Skip((page - 1) * itemsPerPage)
                                      .Take(itemsPerPage)
                                      .ToList();
            // Crear ViewModel para enviar información de paginación
            var viewModel = new PaginationViewModel
            {
                Items = paginatedItems,
                CurrentPage = page,
                TotalPages = (int)Math.Ceiling((double)totalItems / itemsPerPage),
                SearchValue = Search
            };
            return View(viewModel);


        }
